import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { fontFamily } from '@material-ui/system';

const useStyles = makeStyles(theme => ({
  root: {
    background: "#111111",
    paddingTop: theme.spacing(5),
    paddingLeft: theme.spacing(5),
    paddingBottom: theme.spacing(3),
    fontFamily: "null for now"
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'left',
    color: 'black',
    background: 'white',
    minHeight: theme.spacing(15),
  },
  paperContent:{
    display: "block",
    marginTop: theme.spacing(2),
    
  },
  bottomBar:{
    display: "flex",
    flexDirection: "row",
    justifyContent: 'space-between',
    marginTop: theme.spacing(2),
    color: "white"
  },

  leftSide:{
    word:{

    },

    marginLeft: theme.spacing(2)
    
  },

  rightSide:{

  },

}));

export default function Footer() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={3}>
          <Paper className={classes.paper}>Logo here</Paper>
        </Grid>

        <Grid item xs={3}>
          <Paper className={classes.paper}>
            <span className={classes.paperContent}>Profile</span>
            <span className={classes.paperContent}>Signin</span>
            <span className={classes.paperContent}>Music</span>
            </Paper>
        </Grid>

      </Grid>

      <div className={classes.bottomBar}>
        <div className={classes.leftSide}>
          <span className={classes.leftSide.word}>Legal</span>
          
        </div>

        <div className={classes.rightSide}>

        </div>

      </div>
    </div>
  );
}
